import './App.css';
import Book from './components/Book';

function App() {
let books=[
  {
    id:1,
    title:"Think and Grow Rich",
    author:"Nepolian Hill",
    price:199
  },
  {
    id:2,
    title:"ShivCharitra",
    author:"Purushottam Khedekar",
    price:149
  },
  {
    id:3,
    title:"Srimad Bhagavad Gita As It Is : Marathi",
    author:"Swami Prabhupada",
    price:249
  },
  {
    id:4,
    title:"Yayati",
    author:"V. S. Khandekar",
    price:299
  },
]


  return (
  <div className='main-container'>
     {
      books.map((element)=>{
        return <Book id={element.id} title={element.title} author={element.author} price={element.price}/>
      })
     }
  </div>
  );
}


export default App;
